import React from 'react';

const Home = () => {
return (
	<div
	style={{
		display: 'flex',
		justifyContent: 'Left',
		alignItems: 'Left',
		height: '100vh'
	}}
	>
	<h2>Welcome to Tongariro Cinemas!</h2>
	<h3>World Film Festival -June 1, 2023 - June 22, 2023</h3>
		
	</div>
);
};

export default Home;
